import React from 'react';
import './App.css';
import Nav from './nav';

class App extends React.Component {

  sets(){
    localStorage
  }

  render (){
    return (
      <div className="App">
        <Nav />
        <button  onClick={ ()=> this.sets() }></button>
      </div>
    );
  }
}

export default App;
